DROP database IF EXISTS mealdecideplus;
CREATE database `mealdecideplus`;

USE mealdecideplus;

DROP TABLE IF EXISTS Restaurant;
CREATE TABLE IF NOT EXISTS Restaurant(
   restaurant_id           INTEGER  NOT NULL PRIMARY KEY 
  ,name                    VARCHAR(45) NOT NULL
  ,rating                  NUMERIC(3,1)
  ,price_level             VARCHAR(10) NOT NULL
  ,description             VARCHAR(793)
  ,subcategory             VARCHAR(8) NOT NULL
  ,restriction_description VARCHAR(32)
  ,establishment_type      VARCHAR(21) NOT NULL
  ,cuisine_description     VARCHAR(100) NOT NULL
);

DROP TABLE IF EXISTS Contact;
CREATE TABLE IF NOT EXISTS Contact(
   restaurant_id INTEGER  NOT NULL
  ,phone         VARCHAR(15)
  ,website       VARCHAR(234)
  ,email         VARCHAR(32)
  ,address       VARCHAR(78) NOT NULL,
  PRIMARY KEY (restaurant_id),
  CONSTRAINT `fk_restaurant_contact`
    FOREIGN KEY (restaurant_id) REFERENCES restaurant(restaurant_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE
) ENGINE=InnoDB;


DROP TABLE IF EXISTS Cuisine;
CREATE TABLE IF NOT EXISTS Cuisine(
   cuisine_id       INTEGER  NOT NULL PRIMARY KEY 
  ,label            VARCHAR(16) NOT NULL
  ,category         VARCHAR(5) NOT NULL
  ,restaurant_count INTEGER  NOT NULL
  ,recipe_count     INTEGER  NOT NULL
);

DROP TABLE IF EXISTS Restriction;
CREATE TABLE IF NOT EXISTS Restriction(
   restriction_id   INTEGER  NOT NULL PRIMARY KEY 
  ,label            VARCHAR(17) NOT NULL
  ,restaurant_count INTEGER  NOT NULL
  ,recipe_count     INTEGER  NOT NULL
);

DROP TABLE IF EXISTS Restaurant_by_Cuisine;
CREATE TABLE IF NOT EXISTS Restaurant_by_Cuisine(
   cuisine_id    INTEGER  NOT NULL,
    restaurant_id    INTEGER  NOT NULL,
    CONSTRAINT PK_Restaurant_by_Cuisine PRIMARY KEY (restaurant_id, cuisine_id),
    CONSTRAINT `fk_restaurant_restaurant_by_cuisine`
      FOREIGN KEY (restaurant_id) REFERENCES restaurant(restaurant_id)
      ON DELETE CASCADE
      ON UPDATE CASCADE,
    CONSTRAINT `fk_cuisine_restaurant_by_cuisine`
      FOREIGN KEY (cuisine_id) REFERENCES cuisine(cuisine_id)
      ON DELETE CASCADE
      ON UPDATE CASCADE
    ) ENGINE=InnoDB;


DROP TABLE IF EXISTS Restaurant_by_Restriction;
CREATE TABLE IF NOT EXISTS Restaurant_by_Restriction(
    restaurant_id    INTEGER  NOT NULL,
    restriction_id   INTEGER  NOT NULL,
    CONSTRAINT `PK_Restaurant_by_Restriction` PRIMARY KEY (restaurant_id, restriction_id),
    CONSTRAINT `fk_restaurant_restaurant_by_restriction`
      FOREIGN KEY (restaurant_id) REFERENCES restaurant(restaurant_id)
      ON DELETE CASCADE
      ON UPDATE CASCADE,
    CONSTRAINT `fk_restriction_restaurant_by_restriction`
      FOREIGN KEY (restriction_id) REFERENCES restriction(restriction_id)
      ON DELETE CASCADE
      ON UPDATE CASCADE
    ) ENGINE=InnoDB;


