INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (5,'Cheddar''s Scratch Kitchen',4.0,'$$ - $$$','Enjoy your favorites at home with new curbside pickup. View our online menu and place your order To Go. Or come in and enjoy scratch-made American comfort classics in a place that feels like home. Try our signature Homemade Chicken Pot Pie, baked-in-house Honey-Butter Croissants, or our slow-smoked Baby Back Ribs, all at affordable, family-friendly prices. It''s simple, at Cheddar''s Scratch Kitchen, we make it in house so you can get a lot, for not a lot. Come try us today!','sit_down',', Vegetarian, Vegan, Gluten-Free','Restaurants','Bar, American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (6,'McWethy''s Tavern',4.5,'$$ - $$$','Scottish inspired, American made. Located in the new clubhouse at Mistwood Golf Club. With handcrafted & locally sourced cuisine, featuring steaks, chops & signature sandwiches. A full list of spirits, craft beers and wine compliment the cuisine.','sit_down',', Gluten-Free','Restaurants','Pub, Scottish, Bar, American');
