INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (8,'Honey-Jam Cafe',4.0,'$$ - $$$','Come on in! We''re glad to see you! Honey-Jam Cafe is a place where you can gather for any reason and know you will be greeted by a smile, ready to serve you a fresh, delightful meal. We hope our unique and warm surroundings make you feel at home, as if you are visiting a favorite neighbor. Whether you would like to visit us for a meal, contact us for catering, use our free private rooms, let us know what we can do for you.','sit_down',', Vegetarian, Gluten-Free','Restaurants','Cafe, American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (9,'Public Landing',4.0,'$$ - $$$','Serving steak, fresh seafood, homemade Italian dishes and comfort foods in an elegant historic setting. Housed in the Gaylord building in downtown Lockport. We have a gorgeous outdoor patio overlooking the park that allows well behaved dogs to dine with their owners all summer long. Our Yappetizer Menu features: Hot Diggity Dog, Quarter Hounder, Eggs Rover Easy and the Good Dog. House made Sangria is a summer favorite for all of the Public Landing''s great guests. We look forward to seeing you soon.','sit_down',', Vegetarian, Gluten-Free','Restaurants','Bar, American');
