INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (11,'Ted''s Montana Grill',4.0,'$$ - $$$','To Our Guests & Our Communities: We''ve made the difficult decision to temporarily close our Ted’s Montana Grill location in Bolingbrook beginning today as we work to do our part to prevent the spread of COVID-19 and to protect each member of the Ted’s Family. It''s hard, and it''s heartbreaking and we want to assure you we didn’t come to this decision lightly. We greatly appreciate your support and understanding during this extremely difficult time, and hope that you and your loved ones remain healthy. Ted’s Montana Grill is looking forward to opening our doors and serving our communities again very soon.','sit_down',', Gluten-Free','Restaurants','Bar, American');
