INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (15,'The Vegan Cafe',5.0,'$$ - $$$','The Healthy Sins Inc. Vegan Cafe is a raw, organic, gluten-free, and vegan restaurant offering appetizers, entrees, and desserts. The cafe has a relaxed, friendly atmosphere and is located in the heart of downtown Lockport. All of our food is raw, organic, gluten-free, vegan, and DELICIOUS! We hope you''ll visit soon!','sit_down',', Vegetarian, Vegan','Restaurants','American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (16,'Doc Watson''s Smokehouse',5.0,'$$ - $$$','"Doc Watson''s Smokehouse is a family owned and operated restaurant. We serve a central Texas style BBQ. All of our meats come in fresh every week and is smoked in our wood burning smoker. We do not sauce our meats."','sit_down',NULL,'Quick Bites','Barbecue, American');
