INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (19,'Andy''s Frozen Custard',4.5,'$$ - $$$','Andy''s Frozen Custard is a quick service frozen dessert business. We are a freestanding restaurant with drive through and walk-up service windows. We sell delicious frozen custard treats. Andy''s has a wide variety of treats from simple vanilla or chocolate cones to seasonal favorites like our Pumpkin Pie Concretes and Strawberry Shortcake Sundaes.','cafe',NULL,'Dessert','Fast Food, American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (20,'LongHorn Steakhouse',4.0,'$$ - $$$','At LongHorn Steakhouse, we serve steak as it was meant to be - boldly seasoned and expertly grilled by our Grill Masters. Choose from legendary favorites like our Bone-In Outlaw Ribeye or our tender, center-cut Flo''s Filet. And if you love steak, wait until you see what our Grill Masters can do with other favorites like our Parmesan Crusted Chicken, hand-cut LongHorn Salmon or our slow-cooked Baby Back Ribs. Looking for a bigger, better lunch? Try one of our full-sized Steakhouse Lunch Plates, like our Half-Pound Steakhouse Cheeseburger or our Maverick Ribeye Sandwich made with 6 juicy ounces of ribeye steak. Don''t forget to save room for our Chocolate Stampede! Come in today and experience steak done right.','sit_down',', Vegetarian, Gluten-Free','Restaurants','Steakhouse, American');
