INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (26,'Taco Dale',4.5,'$','Taco Diner serves the most authentic Mexican food in Bolingbrook! We serve breakfast, lunch and dinner, and offer complementary chips and salsa to all of our guests. Are you in a hurry? Call ahead for carry-out.We offer a variety of traditional Mexican plates, such as tacos, burritos, tortas, quesadillas, and our fulfilling dinner platters. Try favorites such as our Taco Salad, Fajita Tacos, and our Chile Rellenos. We also have items available ala carte. Taco Diner only uses the best meats, the freshest ingredients, and we prepare all of our dishes to order. We also proudly serve USDA prime skirt steak. Check our website for updated daily specials. Inside of this location check out Ilda''s Ice Cream and Pastries for delicious treats!','sit_down',', Vegetarian','Restaurants','Mexican');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (27,'The Patio',4.0,'$$ - $$$','For over 40 years, our commitment to quality, consistency, and value have made us your perfect choice for family dining. From award-winning barbecue, hearty sandwiches, homemade soups, and garden fresh salads, we offer much more than just great barbecue!','sit_down',', Vegetarian','Restaurants','Barbecue, American');
