INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (33,'Chick-fil-A',5.0,'$','As conditions and regulations about coronavirus evolve and differ across the country, availability of dining options like curbside or full dining room seating will vary by restaurant. What remains unchanged is our commitment to safety and high operating standards, and we are continually adjusting our operations to help protect our Operators, Team Members and Guests.','fast_foo',NULL,'Quick Bites','Fast Food, American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (34,'Home Run Inn Pizza',4.0,'$$ - $$$','Home Run Inn''s three Chicago pizza restaurants and six in the Chicagoland area give you plenty of places to try our authentic homemade pizza. Or enjoy our frozen pizza made with the same all-natural ingredients, homemade sauces and sausage without a single additive or preservative. It''s how we''ve done it ever since we opened our original pizzeria on Chicago''s South Side. Consider it our family''s way of bringing our history home to your family.','sit_down',', Vegetarian','Restaurants','American, Pizza, Italian');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (35,'George''s Restaurant',4.0,'$$ - $$$',NULL,'sit_down',', Vegetarian, Vegan','Restaurants','American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (36,'Lou Malnati''s Pizzeria - Carry Out',4.5,'$$ - $$$','Considered the oldest family name in Chicago pizza, Lou Malnati''s is as rich in history as its deep dish pizza is in flavor. We use only the freshest and finest ingredients to craft each pizza by hand. Come try our legendary deep dish pizza with our famous Buttercrust. You won’t be disappointed! Bolingbrook location offers carry-out, delivery and catering services only.','sit_down',', Vegetarian','Restaurants','Italian, Pizza');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (37,'Islamorada Fish Company',4.0,'$$ - $$$','What began as a tiny marina snack bar in the Florida Keys known for its fresh-from-the-docks seafood is now an acclaimed Bass Pro Shops dining destination. Here, you can still enjoy the original World Famous Islamorada Fish Sandwich in a setting steeped in the magic of the Keys. Soaring beams and glass, a huge saltwater aquarium, and classic fishing lodge décor featuring treasures and trophies from yesteryear provide a stunning backdrop for your dining adventure. On the menu: signature cocktails, exotic appetizers, fresh-daily seafood, hickory-fired rotisserie chicken, wild game, grilled steaks, sandwiches, salads, and (of course) our amazing Key Lime Pie! Treat yourself to the authentic flavors and laid-back ambience of the Keys-stop in today.','sit_down',', Vegetarian, Gluten-Free','Restaurants','Seafood, American');
