INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (43,'Sushi Train Japanese Restaurant',4.0,'$$ - $$$','Our sushi restaurant has been serving Romeoville fresh and delicious sushi since 2006. Check out our lunch specials throughout the week, join us for happy hour on Saturday, or check out one of our daily drink specials. In addition to our full sushi menu, we also offer crowd pleasing Asian favorites so everyone in your group will be pleased. If you''re looking for sushi-on-the-go, check out our take-out menu and call ahead to place your order. If you''re feeding a large group, ask about our party trays and box specials. Come join us to experience the best in service, food, and atmosphere.','sit_down',', Vegetarian','Restaurants','Asian, Sushi, Japanese');
