INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (45,'Bar Louie - The Promenade Bolingbrook',3.5,'$$ - $$$','Eat. Drink. Be Happy. The tenets of the Original Gastrobar. Great drinks, chef-inspired food, and awesome service in a comfortable atmosphere where you are encouraged to relax and hang out. With Bar Louie, no two bars are going to be exactly the same. We listen to our neighborhoods, let them shape us, not the other way around. That''s what makes Bar Louie special. No corners cut, no excuses. It''s not always the easiest way to do things, but it''s the right way. Because if you''re not going to give people something special, why bother at all? So whether you''re looking for good food, a refreshing cocktail, or just conversation, Bar Louie has you covered.','sit_down',', Vegetarian','Restaurants','Pub, Bar, American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (46,'Mongo McMichaels',3.5,'$$ - $$$','Lively Chicago Bears sports bar with over 40 televisions plus big screens to view all Chicago teams. Official Chicago Black Hawks bar. Full bar and menu including; burgers, beef, poorboy variety of sandwiches, wraps, flat breads, pizza, wings, along with daily food and drink specials. Game room features pool tables, televisions, darts and jukebox great for after work gatherings, private parties, and sport team celebrations. Private banquet room available for any occasion offering a full buffet style menu and bar packages. We offer take out and delivery of all menu items as well as catering for your private events.','sit_down',NULL,'Restaurants','Pub, Bar, American');
