INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (54,'Olive Garden Italian Restaurant',4.0,'$$ - $$$','All of your favorites are just a few clicks away! View our menu online and Order Now for convenient Carside Delivery or come in for our famous never-ending first course of freshly baked breadsticks and your choice of homemade soup or garden fresh salad. Enjoy abundant portions of classic Italian favorites the whole family craves like the Tour of Italy, our irresistible Chicken Parmigiana, or everyone''s favorite Fettuccine Alfredo, made fresh from our kitchen to your table. Gather together with the people you love over a meal worth sharing at Olive Garden. We''re all family here.','sit_down',', Vegetarian, Vegan','Restaurants','Italian');
