INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (65,'Pita Zone',5.0,'$','Pita is the exceptional destination for fresh, delicious, and authentic Mediterranean. We share our passion in our cuisines, and our care in service for others, with every Pita served. We believe in offering good food at an affordable price, quick service pace, and topping it off with a smile for every customer.Let your senses indulge on the flavorful variety of foods we offer. Daily Handmade falafels, salads, hummus, and freshly prepared sauces are all served as a compliment to the ever so delightful shawarma and gyro sandwiches. Zabiha Halal food','sit_down','Gluten-Free, Vegan','Restaurants','Sandwiches, Gyros');
