INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (76,'TGI Fridays',4.0,'$$ - $$$','In Manhattan in 1965, there was no place where people could go out to meet friends and make new ones in an environment that was at once both relaxed and yet exciting. Then, Alan Stillman opened Fridays as a way, he said, "to meet Pan Am stewardesses." Suddenly, there was a place with great food, new and exciting drinks and an electric energy. A place where bartenders mixed the environment just as well as they mixed drinks. In short, a place like nowhere else. Today, Fridays in Joliet, IL is still America''s most iconic bar and grill. We embrace and celebrate our heritage as a bar. One that just happens to serve killer food in an environment where it''s always Friday.','fast_foo',', Vegetarian','Restaurants','Bar, American');
