INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (81,'Lock & Mule By Tangled Roots Brewing Company',4.0,'$$ - $$$','Lock & Mule derives its name from Lockport’s wonderful history and association with the I&M canal, where mules would pull longboats up and down the waterways and through the locks that were scattered along the canal. However, it was not only Lockport’s storied history that attracted us to the city – we were equally drawn by its ambitious vision and drive to unlock its potential and create a future even more illustrious than its past.','sit_down',NULL,'Restaurants','Pub, Brew Pub');
