INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (88,'McWethy''s Sports Bar',4.0,'$$ - $$$','Welcome To McQ''s Bar & Grill BOLINGBROOK, ILLINOIS McQ''s is a gathering place for friends and family. A place where you can kick back, relax, grab a cold beer, and enjoy the company of your friends. A place where you can catch any sports game on one of our 30+ TV''s. McQ''s offers Award-Winning Jumbo Wings, Hand-Crafted Sandwiches, Prime Steak Burgers, and much, much more! Our extensive craft beer list features over 30 beer options, and a flavor profile for everyone. Whether you like IPA''s or Pale Ale''s or Lagers, McQ''s craft beer list has you covered! At McQ''s we''re ready to share our excitement with you!','sit_down',NULL,'Restaurants','Pub, Bar');
