INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (97,'Taco Dale',4.5,'$','We serve breakfast, lunch and dinner, and offer complementary chips and salsa to all of our guests. Are you in a hurry? Call ahead for carry-out.We offer a variety of traditional Mexican plates, such as tacos, burritos, tortas, quesadillas, and our fulfilling dinner platters. Try favorites such as our Taco Salad, Fajita Tacos, and our Chile Rellenos. We also have items available ala carte.Taco Diner only uses the best meats, the freshest ingredients, and we prepare all of our dishes to order. We also proudly serve USDA prime skirt steak. Check our website for updated daily specials.','sit_down',', Vegetarian','Quick Bites','Mexican');
