INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (100,'Michael''s Pizza',4.5,'$$ - $$$','Michael''s Pizza of Joliet, IL opened in 1993. We started with pizza and beef but now we have a full menu. Whether you like thin crust, double dough, or stuffed pizza, we have your favorite. Our pizzas are made to order from the finest quality ingredients. Why Michael''s Pizza? The answer is simple. We use only fresh produce, lean meats and 100% mozzarella cheese. We also serve: a variety of savory sandwiches, homemade pastas, fresh choice salads, appetizers and desserts. For over 31 years, we''ve been serving up delicious pizza and sandwiches for take-out or delivery. Call us today.','sit_down',NULL,'Restaurants','Italian');
