INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (142,'Arby''s',4.0,'$','Arby''s is a leading global quick-service restaurant company operating and franchising over 3,400 restaurants worldwide. Arby''s was the first nationally franchised, coast-to-coast sandwich chain and has been serving fresh, craveable meals since it opened its doors in 1964. The Arby''s brand strives to inspire smiles through delicious experiences. We are on a never-ending quest for the perfect sandwich, starting with the Classic Roast Beef and French Dip to the deli-style Market Fresh line of sandwiches and salads.','sit_down',NULL,'Restaurants','American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (143,'McDonald''s',3.5,'$','We are monitoring all local, state and federal regulations to provide customers with contactless ordering options. While some restaurants may have dining rooms open, others are serving customers through the Drive Thru, with Mobile Order & Pay on the McDonald''s App, and with McDelivery®. McDonald''s remains committed to following the data and science with safety as our top priority. In response to the CDC''s guidance, crew and customers will be required to resume wearing masks inside U.S. restaurants in areas with high or substantial transmission, regardless of vaccination status. Masks are always required for customers and crew who are not vaccinated. In addition to performing deep cleaning, safety shields are also in place for protection.','fast_foo','Vegetarian, Gluten-Free','Restaurants','American, Fast Food');
