INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (205,'Pizza Hut',5.0,'$','We are taking additional actions to prioritize safety at our Pizza Hut restaurants in the U.S. Most immediately, we''ve increased the frequency of our already strict sanitizing procedures in high touch point areas in our restaurants like door handles, front counters, credit card machines, seats, dining areas & restrooms. We''ve always had strict hand hygiene & sanitizing procedures in place & continue to reemphasize the importance of our brand health standards. We''re ready to serve you the pizza you love, whether it''s picked up for carryout, at the curb or delivered hot to your doorstep. Pizza Hut has a decades-long history of providing delivery-from our oven to your home-and we''re preparing our team of dedicated drivers for an increased demand in online ordering and delivery service.','sit_down',NULL,'Restaurants','Pizza');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (206,'Steak ''n Shake',3.0,'$','Steak ''n Shake, a classic American brand, was founded in 1934 in Normal, Illinois by Gus Belt who pioneered the concept of premium burgers and milkshakes. For over 85 years, the company''s name has been symbolic of its heritage. The word "steak" stood for steakburger. The term "shake" stood for hand-dipped milkshakes. Gus was determined to serve his customers the finest burgers and shakes in the business. Today, Steak ''n Shake remains the "better burger" leader, serving premium 100% beef steakburgers, hand-dipped milkshakes, thin crispy fries, and more. Steakburgers are made without preservatives or artificial ingredients, topped with fresh produce, and always hand-crafted to order. Other classics include the Frisco Melt, 7x7, Prime Steakburgers, and fan favorite M&M milkshakes.','fast_foo',NULL,'Restaurants','Steakhouse, American');
