INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (268,'Cajun Boil & Bar',1.0,'$$ - $$$','Our unassuming eateries serves up incredibly fresh Cajun seafood boils and classic southern comfort food in a hip atmosphere. With ole'' skool tunes playing and crabs cracking, mimosas flowing during Sunday brunches, our hotspot makes their mark in the communities we serve. Cajun has a Louisiana-inspired menu that is built around shared dishes, culinary treats, and bar favorites that force you to use your bare hands and savor our sauces (it''s all about the sauce!). Guests should be prepared to #getdownanddirty and have some fun!','sit_down',NULL,'Restaurants','Grill, Bar, Seafood');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (269,'Denny''s',2.0,'$','For more than 65 years, Denny''s has been bringing people together over great food. It''s the place where people can relax and be themselves while enjoying classic American comfort food and everyday value. Whether it''s appetizers, breakfast, lunch or dinner, we pride ourselves in serving our guests the diner food they love including favorites like Moons Over My Hammy®, Sizzlin'' Skillets, hand-dipped Milk Shakes, 100% Beef Burgers and the world-famous Build Your Own Grand Slam®. And now, you can bring the diner home by ordering diner classics or our NEW! Family Packs. See you at Denny''s.','sit_down',NULL,'Restaurants','American');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (270,'Steak ''n Shake',2.5,'$','Steak ''n Shake, a classic American brand, was founded in 1934 in Normal, Illinois by Gus Belt who pioneered the concept of premium burgers and milkshakes. For over 85 years, the company''s name has been symbolic of its heritage. The word "steak" stood for steakburger. The term "shake" stood for hand-dipped milkshakes. Gus was determined to serve his customers the finest burgers and shakes in the business. Today, Steak ''n Shake remains the "better burger" leader, serving premium 100% beef steakburgers, hand-dipped milkshakes, thin crispy fries, and more. Steakburgers are made without preservatives or artificial ingredients, topped with fresh produce, and always hand-crafted to order. Other classics include the Frisco Melt, 7x7, Prime Steakburgers, and fan favorite M&M milkshakes.','fast_foo',NULL,'Restaurants','Fast Food, Steakhouse, American');
