INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (296,'Dunkin''',NULL,'$','America''s favorite all-day, everyday stop for coffee, espresso, breakfast sandwiches and donuts. Order your Dunkin'' faves via the drive-thru or order ahead of time with the Dunkin'' mobile app for a fast grab and go experience.','fast_foo','Vegetarian','Coffee & Tea','Fast Food, Cafe');
