INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (299,'Taco Bell',NULL,'$','Find your nearby Taco Bell at 16616 W. 159th Street in Lockport. We''re serving all your favorite menu items, from classic tacos and burritos, to new favorites like the Crunchwrap Supreme and Cheesy Gordita Crunch. Order ahead online or on the mobile app for pick up at the restaurant or get it delivered.','fast_foo','Gluten-Free, Vegetarian','Restaurants','Mexican, Fast Food');
INSERT INTO Restaurant(restaurant_id,name,rating,price_level,description,subcategory,restriction_description,establishment_type,cuisine_description) VALUES (300,'Panera Bread',NULL,'$$','From focusing on quality, clean ingredients to serving our food to you in a warm and welcoming environment, Panera Bread is committed to being an ally to our guests. That means crafting a menu of soups, salads and sandwiches that we are proud to feed our families. You don''t have to compromise to eat well. Whether you want to come in and enjoy a coffee and our complimentary Wi-Fi , or order online using Rapid Pick-Up so you can grab something quickly, Panera Bread Lockport is here with warmth and welcome. Panera Bread. Food as it should be.','sit_down','Vegetarian, Vegan, Gluten-Fre','Restaurants','Sandwiches, Soups, Cafe');
